(13, 'Gorenje 9 Place Settings Dishwasher GV51214UK', '<div class="tab-pane active" id="product-lg-overview">                                                  <h4 class="tab-content-header">Overview</h4>                          <p>The automatic filter cleaning system washes out the food residues to prevent the filter from clogging, and thereby also any problems or errors.<br />  <br />  In case of water spillage, the AquaStop safety system will automatically shut off the water supply to the hose and the machine, and the pump will pump out the remaining water from the dishwasher tub into the drain hose. <br />  <br />  Thus, the dishwasher may be left to operate at night or while nobody is at home, without any fear from flooding.<br />  <br />  Simply by activating the "3 in 1" function, your dishwasher will automatically adjust the washing cycle to tablet 3in1 and omit using the rinse aid, making this function highly convenient. <br />  <br />  If you are using powder or gel detergent, the rinse aid is released to allow optimum dishwashing results and perfect shine.<br />  <br />  Please Note: The above images are for display purposes only. Integrated appliances require a kitchen cabinet door which is not provided. </p>                          <h4 class="tab-content-header">Features</h4>                         <table class="table table-striped table-bordered">                                                     <tr>                                 <td class="nowrap">Place Settings</td>                                 <td>9</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Quick Wash</td>                                 <td>Yes</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Energy Rating</td>                                 <td>A+</td>                             </tr>  