(80, 'Warmlite 2000W Fan Heater Thermo WL44001', '<div class="tab-pane active" id="product-lg-overview">                                                  <h4 class="tab-content-header">Overview</h4>                          <p>Warmlite 2000W Fan Heater Thermo WL44001<br />  <br />  This portable heater has the ideal size and design that allows it to be transported from room to room, or just about anywhere you prefer, to take the chill out of the air. <br />  <br />  The Warmlite Fan Heater has two heating power levels - 1000 W and 2000 W. You can choose between cool, warm and hot air, or adjust the thermostat to the temperature you prefer. Automatic temperature control helps maintain even heat throughout, and prevents over-heating. <br />  <br />  This machine can be used upright or flat. </p>                          <h4 class="tab-content-header">Features</h4>                         <table class="table table-striped table-bordered">                                                     <tr>                                 <td class="nowrap">Colour</td>                                 <td>White</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Brand</td>                                 <td>Warmlite</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Type</td>                                 <td>Fan Heater</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Power</td>                                 <td>2000W</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Energy Rating</td>                                 <td>A</td>                             </tr>                                       