(83, 'Pifco 2000W Fan Heater PE124', '<div class="tab-pane active" id="product-lg-overview">                                                  <h4 class="tab-content-header">Overview</h4>                          <p>Stay cosy during winter cold snaps with the Pifco 2000 W Fan Heater, a neat and versatile solution to heating small to medium sized spaces. <br />  <br />  This freestanding heater can be used upright or flatbed, making it ideal for rooms with limited space. Two heat settings (1000 W and 2000 W) make it ideal for those cold winter mornings and the cool function means it is equally as useful when summer rolls around. <br />  <br />  An overheat protection safety feature is built-in so you need not worry about operational hazards and the fetching white finish means it will complement any home regardless of decor.**<br />  <br />  Dimensions(WxHxD): 252mm x 244mm x 140mm<br />  <br />  Warranty: 1 year<br />  <br />  <br />  </p>                          <h4 class="tab-content-header">Features</h4>                         <table class="table table-striped table-bordered">                                                     <tr>                                 <td class="nowrap">Colour</td>                                 <td>White</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Brand</td>                                 <td>Pifco</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Type</td>                                 <td>Fan Heater</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Power</td>                                 <td>2000W</td>                             </tr>                                                     <tr>                                 <td class