(96, 'Delonghi Fan Heater White HVA3222', '<div class="tab-pane active" id="product-lg-overview">                         <div id="flix-inpage" class="flix-inpage"></div>      <script type="text/javascript" src="//media.flixcar.com/js/embed.js"         data-flix-distributor="11572"         data-flix-language="en"         data-flix-mpn="HVA3222"         data-flix-brand="Delonghi"         data-flix-ean="8004399142978"         data-flix-productinfo="0"         data-flix-videos="1"         data-flix-images="1"         data-flix-documents="1"         data-flix-mainvideo="1"         data-flix-threesixty="0"         data-flix-specs="1"         data-flix-rich="1"         data-flix-features="1"         data-flix-inpage="flix-inpage"         async>     </script>                          <h4 class="tab-content-header">Overview</h4>                          <p>With a lightweight, compact design, this HVE134 fan heater from De''Longhi is great for adding instant warmth to your home or office. Its 2000W output and 2 heat settings, provides you with heat exactly where you need it. An adjustable room thermostat allows you to set and automatically maintain the desired temperature for maximum comfort. The HVE134 fan heater also has a summer ventilation setting, which is great for cooling you down during the hot summer months. Furthermore, thanks to an integrated handle, the HVA3222 can be easily transported from room to room.<br />  <br />  </p>                          <h4 class="tab-content-header">Features</h4>                         <table class="table table-striped table-bordered">                                                     <tr>                                 <td class="nowrap">Colour</td>                                 <td>White</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Brand</td>                                 <td>Delonghi</td>                             </tr>