(104, 'Dyson Tower Fan AM07', '<div class="tab-pane active" id="product-lg-overview">                         <div id="flix-inpage" class="flix-inpage"></div>      <script type="text/javascript" src="//media.flixcar.com/js/embed.js"         data-flix-distributor="11572"         data-flix-language="en"         data-flix-mpn=""         data-flix-brand="Dyson"         data-flix-ean="5025155018187"         data-flix-productinfo="0"         data-flix-videos="1"         data-flix-images="1"         data-flix-documents="1"         data-flix-mainvideo="1"         data-flix-threesixty="0"         data-flix-specs="1"         data-flix-rich="1"         data-flix-features="1"         data-flix-inpage="flix-inpage"         async>     </script>                          <h4 class="tab-content-header">Overview</h4>                          <p>The Dyson Cool AM07 Tower Fan generates smooth, powerful airflow for personal cooling. Like all Dyson bladeless fans, it uses Air Multiplier technology to draw in surrounding air, creating powerful air projection.<br />  <br />  Some fans are quiet but weak others are powerful but noisy. AM07 is quiet and powerful 60 times quieter than Dysons AM02. Dyson engineers have reduced turbulence and noise throughout the machine by channeling airflow more efficiently. Motor noise and vibration have been isolated and significantly reduced.<br />  <br />  AM07 now houses a Helmholtz cavity, designed to capture and dissipate noise from the motor  which has been calibrated to run slower whilst maintaining powerful airflow. An eccentrically aligned loop allows air to ensure with less turbulence, further reducing noise.<br />  <br />  There''s also a remote control for precise airflow control, and a sleep timer. AM07 can be programmed to turn off after preset intervals, for ease of use throughout the night.<br />  <br />  <br />  Dimensions (W x H x D): 230mm x 1010mm x 190mm<br />  <br />  Warranty: 2 years</p>                          <h4 class="tab-content-header">Features</h4>                         <table class="table table-striped table-bordered">                                                     <tr>                                 <td class="nowrap">Colour</td>                                 <td>White</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Brand</td>                                 <td>Dyson</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Type</td>                                 <td>Tower Fan</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Warranty</td>                                 <td>2 Years</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Plug In</td>                                 <td>Yes</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Cordless</td>                                 <td>No</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Cord Length</td>                                 <td>2000mm</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Control Type</td>                                 <td>Buttons + Remote Control</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Additional Features</td>                                 <td>Air Multiplier Technology, Safe, Acoustic Engineering, Energy Efficient, Sleep Timer, Remote Control, Oscillation Control, Easy to Clean.</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Airflow At Max Setting</td>                                 <td>500</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Weight</td>                                 <td>2.9kg</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Width</td>                                 <td>230mm</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Height</td>                                 <td>1010mm</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Depth</td>                                 <td>190mm</td>                             </tr>                                                 </table>                     </div>', '["  Finance Available "]', NULL, 399.95, 16, 0, '2017-03-23 05:44:22'),
(105, 'Dyson Hot and Cool Desk Fan White AM09', '<div class="tab-pane active" id="product-lg-overview">                         <div id="flix-inpage" class="flix-inpage"></div>      <script type="text/javascript" src="//media.flixcar.com/js/embed.js"         data-flix-distributor="11572"         data-flix-language="en"         data-flix-mpn=""         data-flix-brand="Dyson"         data-flix-ean="5025155019320"         data-flix-productinfo="0"         data-flix-videos="1"         data-flix-images="1"         data-flix-documents="1"         data-flix-mainvideo="1"         data-flix-threesixty="0"         data-flix-specs="1"         data-flix-rich="1"         data-flix-features="1"         data-flix-inpage="flix-inpage"         async>     </script>                          <h4 class="tab-content-header">Overview</h4>                          <p>The Dyson AM09 is a hot-cool fan heater. It provides fast even room heating in winter, and powerful cooling in summer which means no need to store away. This is the only fan heater with Ject Focus Control, choose personal mode for long-range powerful airflow, or select diffused mode for wide projection to mix the surrounding air.<br />  <br />  Air is accelerated through an annular aperture, drawing in surrounding air to project smooth, powerful high velocity airflow. Monitors ambient room temperature to provide precise heating control. Target temperature is never exceeded - unlike others that overheat and waste energy.<br />  <br />  With intelligent temperature control, built-in sleep timer and automatic cut out means there will be no disturbance whilst you sleep. You can use in conjunction with air conditioning to efficiently circulate cool air around the room, quickly. Engineered to be quiet with streamlined air channels for reduced airflow turbulence. Quiet Mark awarded by the Noise Abatement Society for improved sound quality. <br />  <br />  Dimensions (W x H x D): 204mm x 588mm x 153mm<br />  <br />  Warranty: 2 years</p>                          <h4 class="tab-content-header">Features</h4>                         <table class="table table-striped table-bordered">                                                     <tr>                                 <td class="nowrap">Colour</td>                                 <td>White</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Brand</td>                                 <td>Dyson</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Warranty</td>                                 <td>2 Years</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Type</td>                                 <td>Fan/Heater</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Weight</td>                                 <td>2.5kg</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Cordless</td>                                 <td>No</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Cord Length</td>                                 <td>1.8m</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Control Type</td>                                 <td>Buttons + Remote Control</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Additional Features</td>                                 <td>Effective all year round, The only fan heater with Jet Focus Control, Patented Air Multiplier Technology, Energy Effecient, Safe, Perfect for Night Time Use, Effienct Air Circulation</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Plug In</td>                                 <td>Yes</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Width</td>                                 <td>204mm</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Height</td>                                 <td>588mm</td>                             </tr>                                                     <tr>                                 <td class="nowrap">Depth</td>                                 <td>153mm</td>                             </tr>                                                 </table>                     </div>', '["  Finance Available "]', NULL, 499.95, 16, 0, '2017-03-23 05:44:33');
